description:
The Power Station Years is an unofficial album released in the fall of 1999. It is a compilation of original demo songs cut by Jon Bon Jovi (then known by his birth name John Bongiovi) recorded at New York's The Power Station studio where he worked before later forming Bon Jovi in 1983. An expanded version entitled The Power Station Years: The Unreleased Recordings with additional tracks was later released.

